INSERT INTO `tb_data_dictionary`(`id`, `code`, `name`, `value`, `status`, `type_id`, `parent_id`, `creation_time`, `sort`, `remark`) VALUES (3,'system.crypto.access.predicate.after', '时间之后', 'After', 1, 4, NULL, '2020-03-29 14:20:36', NULL, '在该日期时间之后发生的请求都将被匹配，如：datetime=2020-01-20T17:42:47.789，在 2020-01-20 17:42:47之后发生的请求都被匹配');
INSERT INTO `tb_data_dictionary`(`id`, `code`, `name`, `value`, `status`, `type_id`, `parent_id`, `creation_time`, `sort`, `remark`) VALUES (4,'system.crypto.access.predicate.before', '时间之前', 'Before', 1, 4, NULL, '2020-03-29 14:20:36', NULL, '在该日期时间之后发生的请求都将被匹配，如：datetime=2020-01-20T17:42:47.789，在 2020-01-20 17:42:47之前发生的请求都被匹配');
INSERT INTO `tb_data_dictionary`(`id`, `code`, `name`, `value`, `status`, `type_id`, `parent_id`, `creation_time`, `sort`, `remark`) VALUES (5,'system.crypto.access.predicate.between', '时间范围', 'Between', 1, 4, NULL, '2020-03-29 14:20:36', NULL, '在该日期时间范围发生的请求都将被匹配，如：datetime1=2020-01-20T17:42:47.789 datetime1=2020-03-20T17:42:47.789，在 2020-01-20 17:42:47 到 2020-03-20T17:42:47 发生的请求都被匹配');
INSERT INTO `tb_data_dictionary`(`id`, `code`, `name`, `value`, `status`, `type_id`, `parent_id`, `creation_time`, `sort`, `remark`) VALUES (6,'system.crypto.access.predicate.cookie', '请求Cookie匹配', 'Cookie', 1, 4, NULL, '2020-03-29 14:20:36', NULL, '请求 Cookie 匹配，如：name=chocolate regexp=ch.p，表示 cookei 存在 chocolate 并且正则表达式对条件 ch.p 通过则匹配');
INSERT INTO `tb_data_dictionary`(`id`, `code`, `name`, `value`, `status`, `type_id`, `parent_id`, `creation_time`, `sort`, `remark`) VALUES (7,'system.crypto.access.predicate.header', '请求头匹配', 'Header', 1, 4, NULL, '2020-03-29 14:20:36', NULL, '请求头匹配，如：name=X-REQUST-ID regexp=\d+，表示 header 存在 X-REQUST-ID 并且正则表达式对条件 \d+ 通过则匹配');
INSERT INTO `tb_data_dictionary`(`id`, `code`, `name`, `value`, `status`, `type_id`, `parent_id`, `creation_time`, `sort`, `remark`) VALUES (8,'system.crypto.access.predicate.host', '访问主机匹配', 'Host', 1, 4, NULL, '2020-03-29 14:20:36', NULL, '访问主机匹配，如：patterns=**.somehost.org,**.anotherhost.org，表示访问来源是 somehost.org 或 **.anotherhost.org 时则匹配');
INSERT INTO `tb_data_dictionary`(`id`, `code`, `name`, `value`, `status`, `type_id`, `parent_id`, `creation_time`, `sort`, `remark`) VALUES (9,'system.crypto.access.predicate.method', '请求方法匹配', 'Method', 1, 4, NULL, '2020-03-29 14:20:36', NULL, '请求方法匹配，如：methods=POST,GET，表示请求是 POST 或 GET，表示请求是 时则匹配');
INSERT INTO `tb_data_dictionary`(`id`, `code`, `name`, `value`, `status`, `type_id`, `parent_id`, `creation_time`, `sort`, `remark`) VALUES (10,'system.crypto.access.predicate.path', '请求路径匹配', 'Path', 1, 4, NULL, '2020-03-29 14:20:36', NULL, '请求路径匹配，如：patterns=/foo/**,/bar/**，表示请求路径是带有/foo/前缀 或 /bar/前缀时则匹配');
INSERT INTO `tb_data_dictionary`(`id`, `code`, `name`, `value`, `status`, `type_id`, `parent_id`, `creation_time`, `sort`, `remark`) VALUES (11,'system.crypto.access.predicate.query', '请求参数匹配', 'Query', 1, 4, NULL, '2020-03-29 14:20:36', NULL, '请求参数匹配，如：param=id regexp=\d+，表示请求参数是 id 并且正则表达式对条件 \d+ 通过则匹配');
INSERT INTO `tb_data_dictionary`(`id`, `code`, `name`, `value`, `status`, `type_id`, `parent_id`, `creation_time`, `sort`, `remark`) VALUES (12,'system.crypto.access.predicate.remote-address', '访问IP匹配', 'RemoteAddr', 1, 4, NULL, '2020-03-29 14:20:36', NULL, '访问IP匹配，如：sources=192.168.0.1/24,192.168.6.1/24 表示只有访问 IP 在 192.168.0.[1到24] 或 192.168.6.[1到24] 时则匹配');
